
function setIconImg(){
    const img = new Image();
    img.onload = () => {
        let imgInstance = new fabric.Image(img, {
            id: Date.now(),
            icon: 'meter',
            left: 150,
            top: 150,
            width: img.width,
            height: img.height,
        });
        canvas.add(imgInstance);
        canvas.renderAll();
    };
    return img;
}

